// User related interfaces
export interface User {
    id: string;
    email: string;
    firstName?: string;
    photoUrl?: string;
}

// Authentication related interfaces
export interface AuthResponse {
    token: string;
    user: User;
}

export interface LoginData {
    email: string;
    password: string;
    remember?: boolean;
}

export interface SignupData {
    firstName: string;
    email: string;
    password: string;
    confirmPassword: string;
    terms: boolean;
}

// Google authentication interfaces
export interface GoogleAuthData {
    googleId: string;
    email: string;
    name: string;
    photoUrl: string;
    idToken: string;
}

export interface GoogleUser {
    getBasicProfile(): {
        getId(): string;
        getEmail(): string;
        getName(): string;
        getImageUrl(): string;
    };
    getAuthResponse(): {
        id_token: string;
    };
}
